    ml: "❌ പൊരുത്തമില്ലാത്തത്. ക്ഷമിക്കണം. മറ്റൊരു ബ്രൗസർ, അല്ലെങ്കിൽ കമ്പ്യൂട്ടർ, അല്ലെങ്കിൽ അനുയോജ്യമായ മറ്റെന്തെങ്കിലും പരീക്ഷിക്കാൻ നിങ്ങൾക്ക് സ്വാഗതം. അല്ലെങ്കിൽ ഈ പഠനം Prolific.com-ലേക്ക് തിരികെ നൽകാൻ CANCEL അമർത്തുക.",
