    hy: "❌ ԱՊՕՐԻՆԻ ՊԱՏԱՍԽԱՆ. Մոդելի անունը պետք է սկսվի «iPhone»-ից, իսկ թաքնված «A» համարը պետք է լինի «A», որին հաջորդում է քառանիշ թիվը:",
