    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: 'TU iPad. Necesitamos detalles que especifiquen su modelo. Ve a Configuración > General > Información. Copia el "Nombre del modelo" en el campo de abajo. Luego toca el "Número de modelo" para revelar el número "A" oculto: una "A" seguida de cuatro dígitos. Escribe eso en el campo de abajo.',
