      "SELECT SAMPLING RATE AND BITS PER SAMPLE (macOS)\n\nPlease configure your audio input device (UMIK-2) using the instructions below to ensure it matches the required settings:\nSampling Rate: 111 Hz\nBits per Sample: 222-bit\n        1.        Open Audio MIDI Setup (in Applications > Utilities).\n        2.        Select your device (UMIK-2) in the left-hand panel.\n        3.        Under “Format,” set:\n        •        Sampling Rate: 111 Hz\n        •        Bit Depth: 222-bit\nOnce configured, return to this web page and click PROCEED or press RETURN.\n\n(The required sampling rate and bit depth are set by the parameters _calibrateSoundSamplingDesiredHz and _calibrateSoundSamplingDesiredBits in the experiment spreadsheet.)",
    fi: "Loading...",
    fr: "SÉLECTIONNEZ LA FRÉQUENCE D'ÉCHANTILLONNAGE ET LES BITS PAR ÉCHANTILLON (macOS)\n\nVeuillez configurer votre périphérique d'entrée audio (UMIK-2) en utilisant les instructions ci-dessous pour vous assurer qu'il correspond aux paramètres requis :\nFréquence d'échantillonnage : 111 Hz\nBits par échantillon : 222 bits\n        1.        Ouvrez Configuration Audio MIDI (dans Applications > Utilitaires).\n        2.        Sélectionnez votre appareil (UMIK-2) dans le panneau de gauche.\n        3.        Sous « Format », réglez :\n        •        Fréquence d'échantillonnage : 111 Hz\n        •        Profondeur de bits : 222 bits\nUne fois configuré, revenez à cette page web et cliquez sur PROCÉDER ou appuyez sur RETOUR.\n\n(La fréquence d'échantillonnage et la profondeur de bits requises sont définies par les paramètres _calibrateSoundSamplingDesiredHz et _calibrateSoundSamplingDesiredBits dans la feuille de calcul de l'expérience.)",
