    "en-UK":
      "SELECT SAMPLING RATE AND BITS PER SAMPLE (Chrome OS)\n\nPlease configure your audio input device (UMIK-2) using the instructions below to ensure it matches the required settings:\nSampling Rate: 111 Hz\nBits per Sample: 222-bit\n\nUnlike macOS or Windows, Chrome OS does not have built-in utilities for adjusting the sampling rate or bit depth. It relies on the default configurations provided by the connected audio device. You are encouraged to pre-configure your UMIK-2 microphone on a compatible system (e.g., macOS or Windows) before connecting it to your Chromebook.\n\nOnce configured, return to this web page and click PROCEED or press RETURN.\n\n(The required sampling rate and bit depth are set by the parameters _calibrateSoundSamplingDesiredHz and _calibrateSoundSamplingDesiredBits in the experiment spreadsheet.)",
    fi: "Loading...",
    fr: "SÉLECTIONNEZ LA FRÉQUENCE D'ÉCHANTILLONNAGE ET LES BITS PAR ÉCHANTILLON (Chrome OS)\n\nVeuillez configurer votre périphérique d'entrée audio (UMIK-2) en utilisant les instructions ci-dessous pour vous assurer qu'il correspond aux paramètres requis :\nFréquence d'échantillonnage : 111 Hz\nBits par échantillon : 222 bits\n\nContrairement à macOS ou Windows, Chrome OS n'a pas d'utilitaires intégrés pour ajuster la fréquence d'échantillonnage ou la profondeur de bits. Il s'appuie sur les configurations par défaut fournies par le périphérique audio connecté. Il est recommandé de préconfigurer votre microphone UMIK-2 sur un système compatible (par exemple, macOS ou Windows) avant de le connecter à votre Chromebook.\n\nUne fois configuré, revenez sur cette page web et cliquez sur PROCÉDER ou appuyez sur RETOUR.\n\n(La fréquence d'échantillonnage et la profondeur de bits requises sont définies par les paramètres _calibrateSoundSamplingDesiredHz et _calibrateSoundSamplingDesiredBits dans la feuille de calcul de l'expérience.)",
