      "Participating in this study allows you to make a meaningful contribution to the advancement of online hearing research by providing essential data on the diverse range of smartphone microphones and computer speakers. This research aims to create a detailed library of device profiles that will enhance the accuracy of hearing tests conducted online. The scheme depends on matching the user's phone microphone to a lab-calibrated microphone. Each model has a different microphone, so it's crucial to specify the model. Understanding that privacy is a priority, please be assured that this survey retains only the model numbers of phones and computers. These model numbers are not linked to any personal information and do not identify you.",
    fi: "Loading...",
    fr: "Participer à cette étude vous permet de contribuer de manière significative à l'avancement de la recherche sur l'audition en ligne en fournissant des données essentielles sur la diversité des microphones de smartphones et des haut-parleurs d'ordinateur. Cette recherche vise à créer une bibliothèque détaillée de profils d'appareils qui améliorera la précision des tests auditifs effectués en ligne. Le schéma dépend de l'appariement du microphone du téléphone de l'utilisateur avec un microphone calibré en laboratoire. Chaque modèle a un microphone différent, il est donc crucial de spécifier le modèle. Comprenant que la confidentialité est une priorité, soyez assuré que cette enquête ne conserve que les numéros de modèle des téléphones et des ordinateurs. Ces numéros de modèle ne sont pas liés à des informations personnelles et ne vous identifient pas.",
