    it: "Partecipare a questo studio ti consente di dare un contributo significativo all'avanzamento della ricerca sull'udito online fornendo dati essenziali sulla vasta gamma di microfoni per smartphone e altoparlanti per computer. Questa ricerca mira a creare una libreria dettagliata di profili dei dispositivi che migliorerà l'accuratezza dei test dell'udito condotti online. Il programma dipende dall'abbinamento del microfono del telefono dell'utente a un microfono calibrato in laboratorio. Ogni modello ha un microfono diverso, quindi è fondamentale specificare il modello. Comprendendo che la privacy è una priorità, ti assicuriamo che questo sondaggio conserva solo i numeri di modello di telefoni e computer. Questi numeri di modello non sono collegati a nessuna informazione personale e non ti identificano.",
