    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "പങ്കെടുക്കാൻ, നിങ്ങളുടെ ഫോണിൻ്റെ ക്യാമറ താഴെയുള്ള QR കോഡിലേക്ക് ചൂണ്ടി, നിങ്ങളുടെ ഫോണിൻ്റെ ഡിസ്പ്ലേയിൽ ദൃശ്യമാകുന്ന ലിങ്കിൽ ടാപ്പ് ചെയ്യുക.",
