    he: "כוון את מצלמת הטלפון שלך אל קוד ה-QR למטה. לאחר מכן הקש על הקישור שמופיע במסך הטלפון שלך.",
    hi: "अपने फ़ोन के कैमरे को नीचे दिए गए QR कोड पर इंगित करें। फिर आपके फ़ोन की स्क्रीन पर दिखाई देने वाले लिंक पर टैप करें।",
    hu: "Irányítsa telefonjának kameráját az alábbi QR-kódra. Ezután érintse meg a telefon képernyőjén megjelenő hivatkozást.",
