    ar: "عذرًا، فشل ظهور رمز الاستجابة السريعة. قم بتحديث الصفحة لمحاولة أخرى. لتحديث الصفحة، اضغط على أيقونة التحديث ⟳ في شريط العنوان. إذا استمرت المشكلة، اضغط على زر لا يمكن الاتصال عبر رمز الاستجابة السريعة أدناه.",
    hy: "Ներեցեք, QR կոդը չհայտնվեց: Թարմացրեք էջը ևս մեկ փորձի համար: Էջը թարմացնելու համար հասցեագոտում հպեք թարմացման պատկերակին ⟳: Եթե ​​խնդիրը չվերանա, սեղմեք ներքևում ՉԻ ՄԻԱՑՆԵԼ QR CODE-ի միջոցով կոճակը:",
    bg: "За съжаление QR кодът не се появи. Опреснете страницата за нов опит. За да опресните страницата, докоснете иконата за опресняване ⟳ в адресната лента. Ако проблемът продължава, натиснете бутона НЕ МОЖЕ ДА СЕ СВЪРЖЕТЕ ЧРЕЗ QR КОД по-долу.",
