    "en-US":
      '1. AVOID INTERRUPTION. If possible, disable alerts. If calibration is interrupted, e.g. by an incoming phone call, hit the "Re-Record" button to begin again.\n2. GRANT PERMISSION. If a pop up asks for permission to use the microphone, click "Allow".\n3. REST PHONE ON A TALL DRINKING GLASS (or coffee mug or soda/beer can), between you and your keyboard, with the microphone (bottom) edge facing your computer. Laptop speakers are in the keyboard; place your phone so that its microphone is on your line of sight to the keyboard. Desktop speakers are behind a grill; point your phone at the grill.\n4. PROCEED. Press "Proceed".',
    ar: '1. تجنب الانقطاع. إذا أمكن، قم بتعطيل التنبيهات. إذا تم مقاطعة المعايرة، مثل مكالمة هاتفية واردة، اضغط على زر "إعادة التسجيل" للبدء من جديد.\n2. منح الإذن. إذا ظهرت نافذة منبثقة تطلب الإذن لاستخدام الميكروفون، انقر على "السماح".\n3. ضع الهاتف على كوب شرب طويل (أو فنجان قهوة أو علبة صودا/بيرة)، بينك وبين لوحة المفاتيح، بحيث يكون حافة الميكروفون (السفلية) موجهة نحو الكمبيوتر. مكبرات الصوت في الكمبيوتر المحمول موجودة في لوحة المفاتيح؛ ضع هاتفك بحيث يكون الميكروفون في خط رؤيتك إلى لوحة المفاتيح. مكبرات الصوت في الكمبيوتر المكتبي موجودة خلف الشبكة؛ وجه هاتفك نحو الشبكة.\n4. تابع. اضغط على "تابع".',
