    "en-UK":
      '1. AVOID INTERRUPTION. If possible, disable alerts. If calibration is interrupted, e.g. by an incoming phone call, hit the "Re-Record" button to begin again.\n2. GRANT PERMISSION. If a pop-up asks for permission to use the microphone, click "Allow".\n3. REST PHONE ON A TALL DRINKING GLASS (or coffee mug or soda/beer can), between you and your keyboard, with the microphone (bottom) edge facing your computer. Laptop speakers are in the keyboard; place your phone so that its microphone is on your line of sight to the keyboard. Desktop speakers are behind a grille; point your phone at the grille.\n4. PROCEED. Press "Proceed".',
    fi: "Loading...",
    fr: '1. ÉVITEZ LES INTERRUPTIONS. Si possible, désactivez les alertes. Si l\'étalonnage est interrompu, par exemple par un appel téléphonique entrant, appuyez sur le bouton "Réenregistrer" pour recommencer. 2. ACCORDEZ LA PERMISSION. Si une fenêtre contextuelle demande l\'autorisation d\'utiliser le microphone, cliquez sur "Autoriser". 3. PLACEZ LE TÉLÉPHONE SUR UN VERRE À BOIRE HAUT (ou une tasse à café ou une canette de soda/bière), entre vous et votre clavier, avec le bord du microphone (en bas) face à votre ordinateur. Les haut-parleurs d\'un ordinateur portable sont dans le clavier ; placez votre téléphone de sorte que son microphone soit dans votre ligne de vue vers le clavier. Les haut-parleurs de bureau sont derrière une grille ; pointez votre téléphone vers la grille. 4. CONTINUEZ. Appuyez sur "Continuer".',
