    no: "3. LAD TELEFON. Lad telefonen til minst 25 %.\n4. INGEN TELEFON. Fjern dekselet slik at mikrofonen ikke er tilstoppet.\n5. Når du er klar, klikk FORTSETT eller trykk RETURN.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "3. NAŁADUJ TELEFON. Naładuj telefon do co najmniej 25%.\n4. BRAK ETUI NA TELEFON. Zdejmij obudowę, aby mikrofon nie był zasłonięty.\n5. Gdy wszystko będzie gotowe, kliknij DALEJ lub naciśnij POWRÓT.",
    pt: "3. CARREGAR O TELEFONE. Carregue o telefone em pelo menos 25%.\n4. SEM CAPA DE TELEFONE. Remova a caixa para que o microfone não fique obstruído.\n5. Quando estiver pronto, clique em PROCEDER ou pressione RETURN.",
    ro: "După 111 cm, este mai dificil să ajungi la tastatura calculatorului, așa că nu ezita să folosești tastatura de pe smartphone-ul tău în schimb.",
    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "3. CARGAR TELÉFONO. Cargue el teléfono al menos al 25%.\n4. SIN FUNDA. Retire la funda para que el micrófono no esté obstruido.\n5. Cuando esté listo, haga clic en CONTINUAR o presione RETORNO.",
    sw: "3. CHAJI SIMU. Chaji simu hadi angalau 25%.\n4. HAKUNA KESI YA SIMU. Ondoa kipochi ili maikrofoni isifungiwe.\n5. Ukiwa tayari, bofya ENDELEA au bonyeza RETURN.",
    sv: "3. LADDA TELEFON. Ladda telefonen till minst 25 %.\n4. INGET TELEFONFODRAL. Ta bort fodralet så att mikrofonen inte är tilltäppt.\n5. När du är klar klickar du på FORTSÄTT eller trycker på RETURN.",
