    tr: "3. TELEFONU ŞARJ EDİN. Telefonu en az %25 oranında şarj edin.\n4. TELEFON DURUMU YOK. Mikrofonun tıkanmaması için kılıfı çıkarın.\n5. Hazır olduğunuzda DEVAM'a tıklayın veya GERİ DÖN'e basın.",
    ur: "3. فون چارج کریں۔ فون کو کم از کم 25% چارج کریں۔\n4. کوئی فون کیس نہیں۔ کیس کو ہٹا دیں تاکہ مائکروفون بند نہ ہو۔\n5. تیار ہونے پر، آگے بڑھنے پر کلک کریں یا واپسی کو دبائیں۔",
