    fr: "Bonjour xxx. Chaque profil que vous contribuez à la bibliothèque de profils sera estampillé avec votre email xxx, pour créditer votre contribution.",
    de: "Hallo xxx. Jedes Profil, das Sie zur Profilbibliothek beitragen, wird mit Ihrer E-Mail-Adresse xxx versehen, um Ihren Beitrag gutzuschreiben.\n\n",
