    kn: "ಹಲೋ xxx. ನಿಮ್ಮ ಕೊಡುಗೆಯನ್ನು ಕ್ರೆಡಿಟ್ ಮಾಡಲು ನೀವು ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಗೆ ಕೊಡುಗೆ ನೀಡುವ ಪ್ರತಿಯೊಂದು ಪ್ರೊಫೈಲ್ ಅನ್ನು ನಿಮ್ಮ ಇಮೇಲ್ xxx ನೊಂದಿಗೆ ಸ್ಟ್ಯಾಂಪ್ ಮಾಡಲಾಗುತ್ತದೆ.\n\n",
    ko: "안녕하세요 xxx님. 귀하가 프로필 라이브러리에 제공하는 각 프로필에는 귀하의 기여를 인정하기 위해 귀하의 이메일 xxx가 찍혀 있습니다.\n\n",
    lt: "Sveiki, xxx. Kiekvienas profilis, kurį prisidedate prie profilių bibliotekos, bus pažymėtas jūsų el. pašto antspaudu xxx, kad būtų įskaitytas jūsų indėlis.\n\n",
