    hr: "Zahvaljujemo na sudjelovanju u našoj anketi. Nemojte odustati. Pritisnite Nastavi kako bismo mogli spremiti rezultate i preusmjeriti vas natrag na Prolific s vašim kodom za dovršetak. Hvala.",
    cs: "Děkujeme, že jste se zúčastnili našeho průzkumu. Neukončujte. Klikněte na Pokračovat, abychom mohli uložit výsledky a přesměrovat vás zpět do Prolific s vaším dokončovacím kódem. Díky.",
    da: "Tak for din deltagelse i vores undersøgelse. Lad være med at holde op. Tryk på Fortsæt, så vi kan gemme resultaterne og omdirigere dig tilbage til Prolific med din færdiggørelseskode. Tak.",
    nl: "Bedankt voor uw deelname aan onze enquête. Geef niet op. Druk op Doorgaan zodat we de resultaten kunnen opslaan en u met uw voltooiingscode terug kunnen sturen naar Prolific. Bedankt.",
    "en-UK":
      "Thank you for participating in our survey. Do not quit. Hit Proceed so we can save the results and redirect you back to Prolific with your completion code. Thanks.",
