    fr: "Merci de participer à notre enquête. Ne quittez pas. Cliquez sur Continuer pour que nous puissions enregistrer les résultats et vous rediriger vers Prolific avec votre code de validation. Merci.",
    de: "Vielen Dank für Ihre Teilnahme an unserer Umfrage. Gib nicht auf. Klicken Sie auf „Weiter“, damit wir die Ergebnisse speichern und Sie mit Ihrem Abschlusscode zurück zu Prolific weiterleiten können. Danke.",
    el: "Σας ευχαριστούμε για τη συμμετοχή σας στην έρευνά μας. Μην τα παρατάς. Πατήστε Συνέχεια για να αποθηκεύσουμε τα αποτελέσματα και να σας ανακατευθύνουμε πίσω στο Prolific με τον κωδικό ολοκλήρωσής σας. Ευχαριστώ.",
    he: "תודה על השתתפותך בסקר שלנו. אל תתפטר. לחץ על המשך כדי שנוכל לשמור את התוצאות ולהפנות אותך בחזרה ל-Prolific עם קוד ההשלמה שלך. תוֹדָה.",
    hi: "हमारे सर्वेक्षण में भाग लेने के लिए धन्यवाद. छोड़ो मत। आगे बढ़ें दबाएं ताकि हम परिणाम सहेज सकें और आपके पूर्णता कोड के साथ आपको वापस प्रोलिफिक पर रीडायरेक्ट कर सकें। धन्यवाद।",
    hu: "Köszönjük, hogy részt vett felmérésünkben. Ne hagyd abba. Nyomja meg a Folytatás gombot, hogy elmenthessük az eredményeket, és visszairányíthassuk a Prolific-hoz a kitöltési kóddal. Köszönöm.",
    is: "Þakka þér fyrir að taka þátt í könnuninni okkar. Ekki hætta. Smelltu á Halda áfram svo við getum vistað niðurstöðurnar og vísað þér aftur til Prolific með útfyllingarkóðanum þínum. Takk.",
    id: "Terima kasih telah berpartisipasi dalam survei kami. Jangan berhenti. Tekan Lanjutkan agar kami dapat menyimpan hasilnya dan mengarahkan Anda kembali ke Prolific dengan kode penyelesaian Anda. Terima kasih.",
    it: "Grazie per aver partecipato al nostro sondaggio. Non uscire. Premi Procedi così possiamo salvare i risultati e reindirizzarti a Prolific con il tuo codice di completamento. Grazie.",
