    kn: "ನಮ್ಮ ಸಮೀಕ್ಷೆಯಲ್ಲಿ ಭಾಗವಹಿಸಿದ್ದಕ್ಕಾಗಿ ಧನ್ಯವಾದಗಳು. ಬಿಡಬೇಡಿ. ಮುಂದುವರೆಯಿರಿ ಒತ್ತಿರಿ ಆದ್ದರಿಂದ ನಾವು ಫಲಿತಾಂಶಗಳನ್ನು ಉಳಿಸಬಹುದು ಮತ್ತು ನಿಮ್ಮ ಪೂರ್ಣಗೊಳಿಸುವಿಕೆ ಕೋಡ್‌ನೊಂದಿಗೆ ನಿಮ್ಮನ್ನು ಮರಳಿ ಪ್ರೊಲಿಫಿಕ್‌ಗೆ ಮರುನಿರ್ದೇಶಿಸಬಹುದು. ಧನ್ಯವಾದಗಳು.",
    ko: "설문조사에 참여해 주셔서 감사합니다. 종료하지 마십시오. 진행을 누르면 결과를 저장하고 완료 코드를 사용하여 Prolific으로 다시 리디렉션할 수 있습니다. 감사해요.",
    lt: "Dėkojame, kad dalyvaujate mūsų apklausoje. Nenutrauk. Spustelėkite Tęsti, kad galėtume išsaugoti rezultatus ir nukreipti jus atgal į Prolific su užbaigimo kodu. Ačiū.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "ഞങ്ങളുടെ സർവേയിൽ പങ്കെടുത്തതിന് നന്ദി. ഉപേക്ഷിക്കരുത്. തുടരുക അമർത്തുക, അതുവഴി ഞങ്ങൾക്ക് ഫലങ്ങൾ സംരക്ഷിക്കാനും നിങ്ങളുടെ പൂർത്തീകരണ കോഡ് ഉപയോഗിച്ച് പ്രോലിഫിക്കിലേക്ക് തിരിച്ചുവിടാനും കഴിയും. നന്ദി.",
    no: "Takk for at du deltok i vår undersøkelse. Ikke slutt. Trykk Fortsett slik at vi kan lagre resultatene og omdirigere deg tilbake til Prolific med fullføringskoden din. Takk.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Dziękujemy za udział w naszej ankiecie. Nie rezygnuj. Kliknij Kontynuuj, abyśmy mogli zapisać wyniki i przekierować Cię z powrotem do Prolific z kodem ukończenia. Dzięki.",
    pt: "Obrigado por participar de nossa pesquisa. Não desista. Clique em Continuar para que possamos salvar os resultados e redirecioná-lo de volta ao Prolific com seu código de conclusão. Obrigado.",
