    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "Gracias por participar en nuestra encuesta. No te rindas. Haz clic en Continuar para que podamos guardar los resultados y redirigirte de nuevo a Prolific con tu código de finalización. Gracias.",
    sw: "Asante kwa kushiriki katika utafiti wetu. Usiache. Gonga Endelea ili tuweze kuhifadhi matokeo na kukuelekeza kwenye Prolific ukitumia msimbo wako wa kukamilisha. Asante.",
