    tr: "Anketimize katıldığınız için teşekkür ederiz. Vazgeçme. Sonuçları kaydedebilmemiz ve sizi tamamlama kodunuzla birlikte Prolific'e geri yönlendirebilmemiz için Devam'a basın. Teşekkürler.",
    ur: "ہمارے سروے میں حصہ لینے کے لیے آپ کا شکریہ۔ مت چھوڑنا۔ آگے بڑھیں کو دبائیں تاکہ ہم نتائج کو محفوظ کر سکیں اور آپ کو آپ کے تکمیلی کوڈ کے ساتھ پرولیفک پر واپس بھیج سکیں۔ شکریہ",
