    sw: "Ikiwa skrini hii itaganda, tafadhali unganisha tena kwa kuelekeza kamera yako mahiri kwenye msimbo wa QR kwenye skrini ya kompyuta yako. Wakati kiungo kinaonekana, kiguse.",
