    fi: "Loading...",
    fr: "À chaque essai, pendant que vous regardez la croix, une lettre aléatoire CLIGNOTERA dans le coin de votre œil. Juste un éclair. Pour apprendre la tâche, essayons d'abord avec un affichage STATIQUE. En regardant la croix, ci-dessous, sans bouger les yeux : Quelle lettre est-ce ?\n\n             +               R  \n\nC'est un R. Cet affichage est statique, donc il serait facile de déplacer vos yeux vers la lettre et de l'identifier. Mais, dans un essai réel, la lettre est CLIGNOTÉE, donc il n'y a pas de temps pour déplacer vos yeux. Veuillez regarder la croix lorsque vous commencez l'essai. Peu importe où vont vos yeux après le flash. Le premier bloc de test est juste quelques essais de pratique, avant que nous commencions sérieusement.",
