    kn: "ನೀವು xxx ಪ್ರಯೋಗಗಳ ಬ್ಲಾಕ್ ಅನ್ನು ಪ್ರಾರಂಭಿಸಲಿರುವಿರಿ. ನೀವು ಒಂದು ಕಥೆಯನ್ನು ಓದುತ್ತೀರಿ, ಒಂದು ಸಮಯದಲ್ಲಿ ಕೆಲವು ಪದಗಳು. ಪ್ರತಿ ಪ್ರಯೋಗವು ವಾಕ್ಯದ ಮೌಲ್ಯದ ಪದಗಳ ಬಗ್ಗೆ ನಿಮಗೆ ತ್ವರಿತವಾಗಿ ತೋರಿಸುತ್ತದೆ, ಒಂದರ ನಂತರ ಒಂದರಂತೆ, ಮತ್ತು ನಂತರ ನೀವು ಓದಿದ ಪದಗಳನ್ನು ನೆನಪಿಟ್ಟುಕೊಳ್ಳಲು ನಿಮ್ಮನ್ನು ಕೇಳುತ್ತದೆ.",
    ko: "xxx 평가판 블록을 시작하려고 합니다. 당신은 한 번에 몇 단어씩 이야기를 읽게 될 것입니다. 각 시험은 한 문장 분량의 단어를 차례로 빠르게 보여주고 읽은 단어를 기억하도록 요청합니다.",
    lt: "Netrukus pradėsite xxx bandymų bloką. Jūs skaitysite istoriją, po kelis žodžius. Kiekvienas bandymas greitai parodys sakinio vertės žodžius vienas po kito, o tada paprašys prisiminti perskaitytus žodžius.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "നിങ്ങൾ xxx ട്രയലുകളുടെ ഒരു ബ്ലോക്ക് ആരംഭിക്കാൻ പോകുകയാണ്. നിങ്ങൾ ഒരു കഥ വായിക്കും, ഒരു സമയം കുറച്ച് വാക്കുകൾ. ഓരോ ട്രയലും ഒന്നിനുപുറകെ ഒന്നായി ഒരു വാക്യ മൂല്യത്തെ കുറിച്ച് നിങ്ങളെ വേഗത്തിൽ കാണിക്കും, തുടർന്ന് നിങ്ങൾ വായിച്ച വാക്കുകൾ ഓർമ്മിക്കാൻ നിങ്ങളോട് ആവശ്യപ്പെടും.",
    no: "Du er i ferd med å starte en blokk med xxx-prøver. Du skal lese en historie, noen få ord om gangen. Hver rettssak vil raskt vise deg om en setningsverdi av ord, den ene etter den andre, og deretter be deg om å huske ordene du leser.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Za chwilę rozpoczniesz blok prób xxx. Będziesz czytać historię, kilka słów na raz. Każda próba szybko pokaże Ci znaczenie słów, jedno po drugim, a następnie poprosi Cię o zapamiętanie przeczytanych słów.",
