    tr: "Bir xxx deneme bloğu başlatmak üzeresiniz. Bir seferde birkaç kelimeden oluşan bir hikaye okuyacaksınız. Her denemede size hızlı bir şekilde bir cümle değerindeki kelimeler birbiri ardına gösterilecek ve ardından okuduğunuz kelimeleri hatırlamanız istenecektir.",
