    kn: "ಸಿದ್ಧವಾಗಿದೆಯೇ? ಗುರಿ ಕಾಣಿಸಿಕೊಳ್ಳುವವರೆಗೆ ಶಿಲುಬೆಯ ಮಧ್ಯಭಾಗವನ್ನು ಟ್ರ್ಯಾಕ್ ಮಾಡಲು ಕರ್ಸರ್ ಬಳಸಿ. ಕರ್ಸರ್ ಅದರ ಮೇಲೆ ಇದ್ದಾಗ ಅಡ್ಡ ದಪ್ಪವಾಗುತ್ತದೆ.",
