    "zh-HK":
      "句子的可理解性會從簡單到困難或不可能。你不可能答對超過三分之二，所以放鬆點。把它想像成一個猜謎遊戲，盡可能地猜到。只要你猜對了，你就會聽到一聲蜂鳴聲。",
    hr: "Razumljivost rečenice varirat će od lake do teške ili nemoguće. Ne možete dobiti više od dvije trećine točno, pa se opustite. Zamislite to kao igru ​​pogađanja i uzmite što više. Čut ćete zvučni signal kad god ste u pravu.",
    cs: "Srozumitelnost věty se bude lišit od snadné až po těžkou nebo nemožnou. Nemůžete dostat víc než dvě třetiny správně, takže se uvolněte. Berte to jako tipovací hru a získejte jich tolik, kolik můžete. Kdykoli budete mít pravdu, uslyšíte pípnutí.",
    da: "Sætningens forståelighed vil variere fra let ned til hård eller umulig. Du kan ikke få meget mere end to tredjedele ret, så slap af. Tænk på det som en gætteleg, og få så mange, som du kan. Du vil høre et bip, når du har ret.",
    nl: "De verstaanbaarheid van de zin varieert van eenvoudig tot moeilijk of onmogelijk. Je kunt niet veel meer dan tweederde goed krijgen, dus ontspan. Zie het als een raadspel en verzamel er zoveel mogelijk. Wanneer u gelijk heeft, hoort u een pieptoon.",
    "en-UK":
      "The intelligibility of the sentence will vary from easy down to hard or impossible. You can't get much more than two-thirds right, so relax. Think of it as a guessing game, and just get as many as you can. You'll hear a beep whenever you're right.",
