    fr: "L'intelligibilité de la phrase variera de facile à difficile ou impossible. Vous ne pouvez pas en obtenir plus des deux tiers corrects, alors détendez-vous. Considérez cela comme un jeu de devinettes, et obtenez-en autant que vous pouvez. Vous entendrez un bip chaque fois que vous avez raison.",
    de: "Die Verständlichkeit des Satzes variiert von leicht bis schwer oder unmöglich. Man kann nicht viel mehr als zwei Drittel richtig hinbekommen, also entspannen Sie sich. Betrachten Sie es als ein Ratespiel und holen Sie sich so viele wie möglich. Wenn Sie Recht haben, hören Sie einen Piepton.",
