    he: "מובנות המשפט תשתנה בין קלה לקשה או בלתי אפשרית. אתה לא יכול לקבל הרבה יותר משני שליש נכון, אז תירגע. תחשוב על זה כעל משחק ניחושים, ופשוט קבל כמה שאתה יכול. אתה תשמע צפצוף בכל פעם שאתה צודק.",
    hi: "वाक्य की बोधगम्यता आसान से कठिन या असंभव तक भिन्न होगी। आप दो-तिहाई से अधिक सही नहीं प्राप्त कर सकते, इसलिए आराम करें। इसे अनुमान लगाने के खेल के रूप में सोचें और जितना संभव हो उतना प्राप्त करें। जब भी आप सही होंगे आपको एक बीप सुनाई देगी।",
    hu: "A mondat érthetősége a könnyűtől a nehézig vagy lehetetlenig változik. A kétharmadnál többet nem tudsz kihozni, szóval lazíts. Tekintsd úgy, mint egy találgatásra, és szerezz be annyit, amennyit csak tudsz. Hangjelzést fog hallani, amikor igaza van.",
    is: "Skiljanleiki setningarinnar er breytilegur frá auðveldum niður í erfitt eða ómögulegt. Þú getur ekki fengið mikið meira en tvo þriðju rétt, svo slakaðu á. Líttu á þetta sem giskaleik og fáðu bara eins marga og þú getur. Þú munt heyra píp þegar þú hefur rétt fyrir þér.",
    id: "Kejelasan kalimat akan bervariasi dari mudah hingga sulit atau tidak mungkin. Anda tidak bisa mendapatkan lebih dari dua pertiganya, jadi santai saja. Anggap saja sebagai permainan tebak-tebakan, dan dapatkan sebanyak yang Anda bisa. Anda akan mendengar bunyi bip kapan pun Anda benar.",
    it: "La comprensibilità della frase varierà da facile a difficile o impossibile. Non puoi ottenere molto più di due terzi giusti, quindi rilassati. Pensalo come un gioco di indovinelli e cerca di prenderne il più possibile. Sentirai un bip ogni volta che hai ragione.",
    ja: "文章のわかりやすさは、簡単なものから難しいもの、不可能なものまでさまざまです。 3 分の 2 以上正解することはできないので、リラックスしてください。推測ゲームと考えて、できるだけ多くの情報を当ててください。正しいときはいつでもビープ音が聞こえます。",
    kn: "ವಾಕ್ಯದ ಗ್ರಹಿಕೆಯು ಸುಲಭದಿಂದ ಕಠಿಣ ಅಥವಾ ಅಸಾಧ್ಯದವರೆಗೆ ಬದಲಾಗುತ್ತದೆ. ನೀವು ಮೂರನೇ ಎರಡರಷ್ಟು ಹೆಚ್ಚು ಬಲ ಪಡೆಯಲು ಸಾಧ್ಯವಿಲ್ಲ, ಆದ್ದರಿಂದ ವಿಶ್ರಾಂತಿ. ಇದನ್ನು ಊಹಿಸುವ ಆಟ ಎಂದು ಯೋಚಿಸಿ, ಮತ್ತು ನೀವು ಎಷ್ಟು ಸಾಧ್ಯವೋ ಅಷ್ಟು ಪಡೆಯಿರಿ. ನೀವು ಸರಿಯಾಗಿದ್ದಾಗಲೆಲ್ಲಾ ನೀವು ಬೀಪ್ ಅನ್ನು ಕೇಳುತ್ತೀರಿ.",
    ko: "문장의 명료도는 쉬운 것부터 어려운 것, 불가능한 것까지 다양합니다. 2/3 이상은 맞힐 수 없으므로 긴장을 푸십시오. 추측 게임이라고 생각하고 가능한 한 많이 얻으세요. 당신이 옳을 때마다 경고음이 들릴 것입니다.",
    lt: "Sakinio suprantamumas skirsis nuo lengvo iki sunkaus ar neįmanomo. Negalite gauti daug daugiau nei du trečdalius, todėl atsipalaiduokite. Pagalvokite apie tai kaip apie atspėjimo žaidimą ir tiesiog gaukite kuo daugiau. Kai būsite teisūs, išgirsite pyptelėjimą.",
    ms: "Di luar 111 cm, lebih sulit untuk mencapai papan ketik komputer Anda, jadi silakan gunakan keypad di smartphone Anda sebagai gantinya.",
    ml: "വാക്യത്തിൻ്റെ ബുദ്ധിശക്തി എളുപ്പം മുതൽ കഠിനമോ അസാധ്യമോ വരെ വ്യത്യാസപ്പെടും. നിങ്ങൾക്ക് മൂന്നിൽ രണ്ട് ഭാഗത്തിൽ കൂടുതൽ ശരിയാക്കാൻ കഴിയില്ല, അതിനാൽ വിശ്രമിക്കുക. ഇതൊരു ഊഹക്കച്ചവടമായി കരുതുക, നിങ്ങൾക്ക് കഴിയുന്നത്രയും നേടൂ. നിങ്ങൾ ശരിയായിരിക്കുമ്പോഴെല്ലാം ഒരു ബീപ്പ് കേൾക്കും.",
    no: "Forståeligheten av setningen vil variere fra lett ned til vanskelig eller umulig. Du kan ikke få mye mer enn to tredjedeler rett, så slapp av. Tenk på det som en gjettelek, og få så mange du kan. Du vil høre et pip når du har rett.",
    fa: "بیش از ۱۱۱ سانتیمتر، دسترسی به صفحه کلید کامپیوتر سخت‌تر می‌شود، بنابراین از صفحه کلید گوشی هوشمند خود استفاده کنید.",
    pl: "Zrozumiałość zdania będzie się wahać od łatwego do trudnego lub niemożliwego. Nie możesz uzyskać więcej niż dwie trzecie, więc zrelaksuj się. Potraktuj to jak grę w zgadywanie i zdobądź ich jak najwięcej. Za każdym razem, gdy będziesz mieć rację, usłyszysz sygnał dźwiękowy.",
    pt: "A inteligibilidade da frase varia de fácil a difícil ou impossível. Você não consegue acertar muito mais do que dois terços, então relaxe. Pense nisso como um jogo de adivinhação e consiga o máximo que puder. Você ouvirá um bipe sempre que estiver certo.",
