    ru: "За пределами 111 см становится сложнее достать до клавиатуры компьютера, поэтому не стесняйтесь использовать клавиатуру на своем смартфоне вместо этого.",
    sr: "Preko 111 cm, teže je dosegnuti tastaturu računara, pa slobodno koristite tastaturu na svom pametnom telefonu umesto toga.",
    es: "La inteligibilidad de la oración variará de fácil a difícil o imposible. No puedes acertar más de dos tercios, así que relájate. Piénsalo como un juego de adivinanzas y acierta tantas como puedas. Escucharás un pitido cada vez que aciertes.",
    sw: "Kueleweka kwa sentensi kutatofautiana kutoka rahisi kwenda chini hadi ngumu au isiyowezekana. Huwezi kupata haki zaidi ya theluthi mbili, kwa hivyo pumzika. Ifikirie kama mchezo wa kubahatisha, na upate nyingi uwezavyo. Utasikia mlio wakati wowote ukiwa sahihi.",
    sv: "Förståeligheten av meningen kommer att variera från lätt till svårt eller omöjligt. Du kan inte få mycket mer än två tredjedelar rätt, så slappna av. Se det som ett gissningsspel och få så många du kan. Du kommer att höra ett pip när du har rätt.",
    tl: "Sa higit sa 111 cm, mas mahirap na maabot ang keyboard ng iyong computer, kaya maaari kang gumamit ng keypad sa iyong smartphone sa halip.",
