    ur: "جملے کی سمجھ بوجھ آسان سے مشکل یا ناممکن تک مختلف ہوگی۔ آپ دو تہائی سے زیادہ حق حاصل نہیں کر سکتے، اس لیے آرام کریں۔ اسے اندازہ لگانے والے کھیل کے طور پر سوچیں، اور جتنا ہو سکے حاصل کریں۔ جب بھی آپ صحیح ہوں گے آپ کو ایک بیپ سنائی دے گی۔",
